			Id = 31566704,
			Name = "USDC",
			UnitName = "USDC",
			Decimals = 6
		};

		public static Asset Asset2 = new Asset {
			Id = 0,
			Name = "Algo",
			UnitName = "ALGO",
			Decimals = 6
